PROBLEM: 'Pablo, Sofia, and Mia got some candy eggs at a party.  Pablo had three times as many eggs as Sofia, and Sofia had twice as many eggs as Mia.  Pablo decides to give some of his eggs to Sofia and Mia so that all three will have the same number of eggs.  What fraction of his eggs should Pablo give to Sofia?\n'
=======
CHOICES:
[A]: \frac{1}{12}
[B]: \frac{1}{6}
[C]: \frac{1}{4}
[D]: \frac{1}{3}
[E]: \frac{1}{2}

PROBLEM: 'The sum of two positive numbers is '$5$' times their difference. What is the ratio of the larger number to the smaller number?\n'
=======
CHOICES:
[A]: \frac{5}{4}
[B]: \frac{3}{2}
[C]: \frac{9}{5}
[D]: 2
[E]: \frac{5}{2}

PROBLEM: 'Points '$( \sqrt{\pi} , a)$' and '$( \sqrt{\pi} , b)$' are distinct points on the graph of '$y^2 + x^4 = 2x^2 y + 1$'. What is '$|a-b|$'?\n'
=======
CHOICES:
[A]: 1
[B]: \frac{\pi}{2}
[C]: 2
[D]: \sqrt{1+\pi}
[E]: 1 + \sqrt{\pi}

PROBLEM: 'A line that passes through the origin intersects both the line '$x = 1$' and the line '$y=1+ \frac{\sqrt{3}}{3} x$'. The three lines create an equilateral triangle. What is the perimeter of the triangle?\n'
=======
CHOICES:
[A]: 2\sqrt{6}
[B]: 2+2\sqrt{3}
[C]: 6
[D]: 3 + 2\sqrt{3}
[E]: 6 + \frac{\sqrt{3}}{3}

PROBLEM: 'The isosceles right triangle '$ABC$' has right angle at '$C$' and area '$12.5$'. The rays trisecting '$\angle ACB$' intersect '$AB$' at '$D$' and '$E$'. What is the area of '$\bigtriangleup CDE$'?\n'
=======
CHOICES:
[A]: \dfrac{5\sqrt{2}}{3}
[B]: \dfrac{50\sqrt{3}-75}{4}
[C]: \dfrac{15\sqrt{3}}{8}
[D]: \dfrac{50-25\sqrt{3}}{2}
[E]: \dfrac{25}{6}

PROBLEM: 'Eight people are sitting around a circular table, each holding a fair coin. All eight people flip their coins and those who flip heads stand while those who flip tails remain seated. What is the probability that no two adjacent people will stand?\n'
=======
CHOICES:
[A]: \dfrac{47}{256}
[B]: \dfrac{3}{16}
[C]: \dfrac{49}{256}
[D]: \dfrac{25}{128}
[E]: \dfrac{51}{256}
